import React from 'react';
import Nav from './Nav.js';
import Home from './Home.js';

import {
  BrowserRouter as Router,
  Route,
  Routes,
} from "react-router-dom";


export default function CompleteApp(){
    return (
        <Router>
            <Nav />
            <Routes>
                <Route exact path="/">
                    <Home />
                </Route>
            </Routes>
        </Router>
    );
}
